import { initializeApp } from "firebase/app";
import { getAuth, signOut, } from "firebase/auth";
import { useNavigate } from "react-router-dom";

function Main() {

    const navigate = useNavigate()

    const firebaseConfig = {
        apiKey: "AIzaSyClEH1wG_p4Bk7y8dl88UEi1OcSmd_7Yl4",
        authDomain: "pro-app-7adb5.firebaseapp.com",
        projectId: "pro-app-7adb5",
        storageBucket: "pro-app-7adb5.appspot.com",
        messagingSenderId: "840528707586",
        appId: "1:840528707586:web:759e54f6d5ecf02251671b",
        measurementId: "G-Q000JTLWD8"
    };

    const app = initializeApp(firebaseConfig);
    const auth = getAuth()
    const submitData = (event) => {
        event.preventDefault()


        signOut(auth)
            .then(() => {
                alert("Logout successfull")
                navigate("/Login")
            })
            .catch(() => {
                alert("error")
            })

    }

    return (


        <div class="container-fluid">
            <div class="row">
                <div class="col-sm-2">
                    <img src="https://img.freepik.com/free-vector/mobile-store-logo-design_23-2149716936.jpg"  style={{width:"50px"}} alt="mob"></img>
                </div>
                <div class="col">
                    <nav class="navbar bg-body-tertiary">
                        <div class="container-fluid">
                            <form class="d-flex" role="search">
                                <input class="form-control me-2" type="search" placeholder="Search" style={{width:"400px"}}></input>
                                <button class="btn btn-outline-success" type="submit">Search</button>
                            </form>
                        </div>
                    </nav>
                </div>
                <div class="col">
                <i class="fa-solid fa-bell-concierge"></i>
                    <div></div>
                </div>
            </div>
            <div class="col">

                <form onSubmit={submitData}>
                    <button type="submit" class="btn btn-danger">Logout</button>
                </form>
            </div>
        </div>
    )
}
export default Main;
